import './competence.css';
import { ReactComponent as PythonIcon } from './icons/python.svg';
import { ReactComponent as JavaScriptIcon } from './icons/javascript.svg';
import { ReactComponent as CppIcon } from './icons/c++.svg';
import { ReactComponent as HtmlIcon } from './icons/html-5.svg';
import { ReactComponent as CssIcon } from './icons/css3.svg';
import { ReactComponent as VscodeIcon } from './icons/vscode.svg';
import { ReactComponent as GitIcon } from './icons/git.svg';
import { ReactComponent as GithubIcon } from './icons/github.svg';
import { ReactComponent as ReactIcon } from './icons/react.png';
import { ReactComponent as NodejsIcon } from './icons/nodejs.svg';
import { ReactComponent as FrenchIcon } from './icons/french.png';
import { ReactComponent as EnglishIcon } from './icons/english.png';



function Competence() {
    return (
        <section id="competence">
          <h2>Comp√©tences :</h2>
          <ul className="competence-list">
            <li className="competence-item">
              <CppIcon style={{ fontSize: '24px', marginRight: '8px' }} />
              C
            </li>
            <li className="competence-item">
              <PythonIcon style={{ fontSize: '24px', marginRight: '8px' }} />
              Python
            </li>
            <li className="competence-item">
              <JavaScriptIcon style={{ fontSize: '24px', marginRight: '8px' }} />
              JavaScript
            </li>
            <li className="competence-item">
              <HtmlIcon style={{ fontSize: '24px', marginRight: '8px' }} />
              HTML
            </li>
            <li className="competence-item">
              <CssIcon style={{ fontSize: '24px', marginRight: '8px' }} />
              CSS
            </li>
          </ul>
        </section>
    );
}

export default Competence;
